  \"Analyzing stakeholder preferences for managing elk and bison at the National Elk
  Refuge and Grand Teton National Park : An example of the disparate stakeholder management
  approach\",\n\t\"tracking_summary\": {\n\t\t\"total\": 61,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
